import React, {useState} from 'react';
import Gasto from './Gasto';
import PropTypes from 'prop-types';

function Listado({gastos}) {
    return(
    <div className="gastos-realizados">
        <h2>Listado</h2>
        {gastos.map(gasto =>(
            <Gasto
                key={gasto.id}
                gasto={gasto}/>
        ))}
    </div>
    );
}

Listado.propTypes = {
    gastos: PropTypes.array.isRequired
}

export default Listado;
